import { Box, Grommet, Tab, Tabs, Form, FormField, Button, TextInput } from 'grommet';
import React from 'react';
import Foooter from './Foooter';
import Headerr from './Headerr';
import Module1 from './Module1';

export default function TabTile (props) {

    const theme = {
        global: {
          colors: {
            brand: '#01A982',
          },
          font: {
            family: 'Roboto',
            size: '18px',
            height: '20px',
          },
        },
      };

    return(
        <Grommet theme={theme}>
        <Headerr />
        <Box pad="small">
        <Tabs>
            <Tab title="Procurement" tabIndex="1">
                <Box justify="center" pad="small">
                    <Box direction="column" alignSelf="center"  border={{ color: 'brand', size: 'small' }} pad="small"> 
                        <Form key={1}>
                            <FormField label={props.label} >
                            <TextInput placeholder={props.placeholder} name={props.name} />
                            </FormField>
                           
                            <Button key={1} type="submit" primary label="Submit" />
                        </Form>
                    </Box> 
                </Box> 
            </Tab>
            <Tab title="Forwader" tabIndex="2" />
            <Tab title="CHA" tabIndex="3" />
            <Tab title="Supplier & Product" tabIndex="4" />
            <Tab title="Customs" tabIndex="5" />
            <Tab title="Invoice Remittance" tabIndex="6" />
            <Tab title="Asset-Grave" tabIndex="7" />
        </Tabs>
        </Box>
        <Foooter />
        </Grommet>
    ); 
}
